import * as React from 'react'
import Gallery from '../components/Gallery/Gallery'

function Home(props) {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Accueil</h1>
        <Gallery data={props.data} />
      </header>
    </div>
  )
}

export default Home
